// src/components/UniversityList.js

import React, { useEffect, useState } from 'react';
import axios from 'axios';

const UniversityList = () => {
  const [universities, setUniversities] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch universities from the backend API
  useEffect(() => {
    axios.get('http://localhost:5000/api/universities')
      .then(response => {
        setUniversities(response.data.universities);
        setLoading(false);
      })
      .catch(err => {
        setError("Failed to load universities");
        setLoading(false);
      });
  }, []);

  if (loading) return <p>Loading universities...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div>
      <h1 >List of Universities</h1>
      <table>
        <thead>
          <tr>
            <th>University Name</th>
            <th>Location</th>
            <th>Tuition Fees (UG)</th>
            <th>Tuition Fees (PG)</th>
            <th>Scholarships Available</th>
            <th>Educational Domains</th>
            <th>Societies</th>
            <th>International Support</th>
            <th>Research Opportunities</th>
            <th>Rankings</th>
          </tr>
        </thead>
        <tbody>
          {universities.map((university, index) => (
            <tr key={index}>
              <td>{university.universityName}</td>
              <td>{university.location}</td>
              <td>{university.tuitionFeesUG}</td>
              <td>{university.tuitionFeesPG}</td>
              <td>{university.scholarshipsAvailable}</td>
              <td>{university.educationalDomains}</td>
              <td>{university.societies}</td>
              <td>{university.internationalSupport}</td>
              <td>{university.researchOpportunities}</td>
              <td>{university.rankings}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UniversityList;
